syntax = "proto3";
package snapchat.snapdoc;
option optimize_for = CODE_SIZE;
option objc_class_prefix = "SDM";
option csharp_namespace = "SnapProto.Snapchat.Snapdoc";

import "snapchat/core/SCCOREUuid.proto";

message SDMGameAttachment {
    .snapchat.core.SCCOREUUID id_p = 1;
    string displayName = 2;
    string contentURL = 3;
    string iconImageURL = 4;
    string loadingPageImageURL = 5;
    string logoURL = 6;
}